// Mixins: Breakpoint\n// A 16px base value is passed to em() functions within breakpoint mixins due\n// to browsers not using the Gesso base font size for media query calculations.\n\n@use 'sass:string';\n@use '../config.settings' as *;\n@use '../functions' as *;\n\n// Create a min-width media query.\n// @param {Number} $breakpoint - width value.\n@mixin breakpoint-min($breakpoint) {\n  @if $breakpoints-ems {\n    $breakpoint: em($breakpoint, 16px);\n  }\n  @media (min-width: #{$breakpoint}) {\n    @content;\n  }\n}\n\n// Assume min-width if shorthand breakpoint mixin is used.\n// @param {Number} $breakpoint - width value.\n@mixin breakpoint($breakpoint) {\n  @include breakpoint-min($breakpoint) {\n    @content;\n  }\n}\n\n// Create a max-width media query.\n// @param {Number} $breakpoint - width value.\n// @param {Boolean} $subtract_1_from_max - whether to subtract 1px from $breakpoint value.\n@mixin breakpoint-max($breakpoint, $subtract_1_from_max: false) {\n  @if $subtract_1_from_max {\n    $breakpoint: px($breakpoint) - 1px;\n  }\n  @if $breakpoints-ems {\n    $breakpoint: em($breakpoint, 16px);\n  }\n  @media (max-width: #{$breakpoint}) {\n    @content;\n  }\n}\n\n// Create a media query with both min-width and max-width.\n// @param {Number} $breakpoint-min - width value.\n// @param {Number} $breakpoint-max - width value.\n// @param {Boolean} $subtract_1_from_max - whether to subtract 1px from $breakpoint-max value.\n@mixin breakpoint-min-max(\n  $breakpoint-min,\n  $breakpoint-max,\n  $subtract_1_from_max: false\n) {\n  @if $subtract_1_from_max {\n    $breakpoint-max: px($breakpoint-max) - 1px;\n  }\n  @if $breakpoints-ems {\n    $breakpoint-min: em($breakpoint-min, 16px);\n    $breakpoint-max: em($breakpoint-max, 16px);\n  }\n  @media (min-width: #{$breakpoint-min}) and (max-width: #{$breakpoint-max}) {\n    @content;\n  }\n}\n","// Component: Hero with Inline Image\n\n@use '00-config' as *;\n\n$hero-inline-image-bp: gesso-breakpoint(desktop) !default;\n\n.c-hero-inline-image {\n  @include breakpoint($hero-inline-image-bp) {\n    color: gesso-color(text, on-dark);\n    position: relative;\n    text-align: center;\n\n    &.has-overlay {\n      &::after {\n        background: rgba(0, 0, 0, 0.5);\n        bottom: 0;\n        content: '';\n        left: 0;\n        position: absolute;\n        right: 0;\n        top: 0;\n        z-index: 1;\n      }\n\n      .c-hero-inline-image__content {\n        z-index: 2;\n      }\n    }\n  }\n}\n\n.c-hero-inline-image__media {\n  display: block;\n  line-height: 0;\n  margin-bottom: rem(gesso-spacing(3));\n\n  @include breakpoint($hero-inline-image-bp) {\n    margin-bottom: 0;\n  }\n\n  img,\n  picture {\n    width: 100%;\n  }\n}\n\n.c-hero-inline-image__content {\n  @include breakpoint($hero-inline-image-bp) {\n    bottom: 5%;\n    display: flex;\n    flex-direction: column;\n    justify-content: center;\n    left: 15%;\n    position: absolute;\n    right: 15%;\n    top: 5%;\n  }\n}\n\n.c-hero-inline-image__title {\n  @include display-text-style(display);\n  margin-bottom: rem(gesso-spacing(3));\n\n  @include breakpoint($hero-inline-image-bp) {\n    color: gesso-color(text, on-dark);\n    margin-bottom: rem(gesso-spacing(5));\n  }\n\n  @include breakpoint-max($hero-inline-image-bp, true) {\n    font-size: rem(gesso-font-size(8));\n  }\n}\n\n.c-hero-inline-image__summary {\n  @include display-text-style(body-large);\n  margin-bottom: rem(gesso-spacing(3));\n\n  @include breakpoint($hero-inline-image-bp) {\n    color: gesso-color(text, on-dark);\n    margin-bottom: rem(gesso-spacing(5));\n  }\n}\n\n.c-hero-inline-image--left {\n  .c-hero-inline-image__content {\n    @include breakpoint($hero-inline-image-bp) {\n      align-items: flex-start;\n      left: 10%;\n      right: 35%;\n    }\n  }\n}\n\n.c-hero-inline-image--right {\n  .c-hero-inline-image__content {\n    @include breakpoint($hero-inline-image-bp) {\n      align-items: flex-start;\n      left: 35%;\n      right: 10%;\n    }\n  }\n}\n","// Mixins: Display Text Style\n\n@use '../functions' as *;\n@use './responsive-font-size' as *;\n\n@mixin display-text-style($keys...) {\n  $display: gesso-get-map(typography, display, $keys...);\n\n  @each $property, $value in $display {\n    @if ($property == 'responsive-font-size') {\n      @include responsive-font-size($value);\n    } @else if ($property == 'font-size') {\n      // Check for px if not output value.\n      #{$property}: #{rem(convert($value))};\n    } @else {\n      #{$property}: #{$value};\n    }\n  }\n}\n","// Mixins: Responsive Font Size\n\n@use '../config.settings' as *;\n@use '../functions' as *;\n\n@mixin custom-responsive-font-size($min-size, $max-size, $ideal-size: 'auto') {\n  $min-size: rem($min-size);\n  $max-size: rem($max-size);\n  @if $min-size == $max-size {\n    font-size: $min-size;\n  } @else {\n    @if $ideal-size == 'auto' {\n      // For more details on how we calculate the ideal size:\n      // https://css-tricks.com/linearly-scale-font-size-with-css-clamp-based-on-the-viewport/\n      $ideal-size: ideal-font-size($min-size, $max-size);\n    } @else {\n      $ideal-size: rem($ideal-size);\n    }\n\n    font-size: clamp(#{$min-size}, #{$ideal-size}, #{$max-size});\n    // stylelint-disable-next-line\n    -webkit-marquee-increment: 0vw; // Needed to get clamp() to work in Safari.\n  }\n}\n\n@mixin responsive-font-size($font-scale) {\n  $min-size: gesso-get-map(typography, responsive-font-size, $font-scale, min);\n  $max-size: gesso-get-map(typography, responsive-font-size, $font-scale, max);\n  $ideal-size: gesso-get-map(\n    typography,\n    responsive-font-size,\n    $font-scale,\n    val\n  );\n\n  @include custom-responsive-font-size($min-size, $max-size, $ideal-size);\n}\n"],sourceRoot:""}]),__webpack_exports__.Z=___CSS_LOADER_EXPORT___},"./source/03-components/hero-inline-image/hero-inline-image.yml":function(module){const doc=[{has_overlay:!0,hero_title:"Hero Title",hero_summary:"<p>Hero summary text.</p>",he